// OrderDetailModal Component
const OrderDetailModal = ({ order, onClose }) => {
  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal-content" onClick={e => e.stopPropagation()}>
        <div className="modal-header">
          <h2>Order Details</h2>
          <button className="close-btn" onClick={onClose}>
            <FaTimes />
          </button>
        </div>
        <div className="modal-body">
          <div className="order-info">
            <h3>Order Information</h3>
            <div className="info-grid">
              <div className="info-item">
                <label>Order ID</label>
                <span>{order.orderId}</span>
              </div>
              <div className="info-item">
                <label>Medicine</label>
                <span>{order.medicine}</span>
              </div>
              <div className="info-item">
                <label>Quantity</label>
                <span>{order.quantity}</span>
              </div>
              <div className="info-item">
                <label>Amount</label>
                <span>${order.amount}</span>
              </div>
              <div className="info-item">
                <label>Supplier</label>
                <span>{order.supplier}</span>
              </div>
              <div className="info-item">
                <label>Status</label>
                <span className={`status-badge ${order.status.toLowerCase()}`}>
                  {order.status}
                </span>
              </div>
            </div>
          </div>
          
          <div className="tracking-timeline">
            <h3>Tracking Information</h3>
            <div className="timeline">
              {order.tracking.updates.map((update, index) => (
                <div key={index} className="timeline-item">
                  <div className="timeline-marker"></div>
                  <div className="timeline-content">
                    <h4>{update.status}</h4>
                    <p>{update.location}</p>
                    <span className="timeline-date">{update.date}</span>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const Orders = () => {
  const [activeTab, setActiveTab] = useState('active');
  const [orders, setOrders] = useState([]);
  const [healthTrends, setHealthTrends] = useState(null);
  const [isRefreshing, setIsRefreshing] = useState(false);
  const [selectedOrder, setSelectedOrder] = useState(null);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = () => {
    setOrders(generateSampleOrders(50));
    setHealthTrends(generateHealthTrends());
  };

  const refreshTrends = async () => {
    setIsRefreshing(true);
    await new Promise(resolve => setTimeout(resolve, 1500));
    setHealthTrends(generateHealthTrends());
    setIsRefreshing(false);
  };

  const renderActiveOrders = () => (
    <div className="orders-grid">
      {orders.map(order => (
        <div 
          key={order.orderId}
          className="order-card"
          onClick={() => setSelectedOrder(order)}
        >
          <div className="order-card-header">
            <h3>{order.medicine}</h3>
            <span className={`status-badge ${order.status.toLowerCase()}`}>
              {order.status}
            </span>
          </div>
          <div className="order-card-body">
            <p><strong>Order ID:</strong> {order.orderId}</p>
            <p><strong>Quantity:</strong> {order.quantity}</p>
            <p><strong>Expected Delivery:</strong> {order.expectedDelivery}</p>
            <p><strong>Amount:</strong> ${order.amount}</p>
          </div>
          <div className="order-card-footer">
            <span className={`priority-badge ${order.priority.toLowerCase()}`}>
              {order.priority} Priority
            </span>
          </div>
        </div>
      ))}
    </div>
  );

  const renderPredictions = () => (
    <div className="insights-container">
      <div className="health-trends">
        <h2>Local Health Trends</h2>
        <div className="trend-metrics">
          {healthTrends?.localOutbreaks.map((outbreak, index) => (
            <div 
              key={index}
              className="metric-card"
            >
              <h3>{outbreak.disease}</h3>
              <div className="metric-value">{outbreak.intensity}</div>
              <p>Trend: {outbreak.trend}</p>
              <div className="affected-areas">
                {outbreak.affectedAreas.map(area => (
                  <span key={area} className="area-tag">{area}</span>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>

      <div className="weather-impact">
        <h2>Environmental Factors</h2>
        <div className="weather-metrics">
          {healthTrends?.weatherImpact && (
            <>
              <div className="weather-card">
                <h3>Temperature</h3>
                <div className="weather-value">{healthTrends.weatherImpact.temperature}</div>
              </div>
              <div className="weather-card">
                <h3>Air Quality</h3>
                <div className="weather-value">{healthTrends.weatherImpact.airQuality}</div>
              </div>
            </>
          )}
        </div>
      </div>
    </div>
  );

  return (
    <div className="orders-modern-container">
      <div className="orders-header">
        <h1>Order Management & Analytics</h1>
        <div className="header-actions">
          <button className="refresh-btn" onClick={refreshTrends} disabled={isRefreshing}>
            <FaSync className={isRefreshing ? 'spinning' : ''} /> Refresh Trends
          </button>
        </div>
      </div>

      <div className="orders-navigation">
        <button 
          className={`nav-btn ${activeTab === 'active' ? 'active' : ''}`}
          onClick={() => setActiveTab('active')}
        >
          <FaBoxes /> Active Orders
        </button>
        <button 
          className={`nav-btn ${activeTab === 'history' ? 'active' : ''}`}
          onClick={() => setActiveTab('history')}
        >
          <FaHistory /> Order History
        </button>
        <button 
          className={`nav-btn ${activeTab === 'predictions' ? 'active' : ''}`}
          onClick={() => setActiveTab('predictions')}
        >
          <FaBrain /> AI Insights
        </button>
      </div>

      <div className="tab-content">
        {activeTab === 'active' && renderActiveOrders()}
        {activeTab === 'predictions' && renderPredictions()}
        {activeTab === 'history' && renderActiveOrders()}
      </div>

      {selectedOrder && (
        <OrderDetailModal 
          order={selectedOrder} 
          onClose={() => setSelectedOrder(null)}
        />
      )}
    </div>
  );
};

export default Orders;
